import axios from "axios";
import axiosCors from "../../Module/interceptor/axiosCorsInterceptor";

const testGet = () => {
    axiosCors.get("/oauth2/csrf").then((resp) => {
        console.log(resp);
    })
}

const testPost = () => {
    axios.get("/oauth2/csrf")
        .then(tokenResp => {
            let config = {
                headers: {
                    'X-CSRF-TOKEN': tokenResp.data.token,
                }
            }
            axios.post("/test", null, config).then((resp) => {
                console.log(resp);
            })
        })
}

const logout = () => {
    axios.get("/oauth2/csrf")
        .then(tokenResp => {
            let config = {
                headers: {
                    'X-CSRF-TOKEN': tokenResp.data.token,
                }
            }
            axios.post("/oauth2/logout", null, config).then((resp) => {
                // window.location.assign("/");
                console.log(resp);
            })
        })
}

export default function SignUp() {

    return (
        <main style={{ padding: "1rem 0" }}>
            <h2>SignUp</h2>
            <button onClick={logout}>Logout</button>
            <button onClick={testGet}>testGet</button>
            <button onClick={testPost}>testPost</button>
        </main>
    );
}
